import axios from 'axios';
class AuthRepo {

     constructor(){
         this.apiEndpoint = "http://localhost:8080";
         this.login = this.apiEndpoint+'/users/login';
         this.signup = this.apiEndpoint+'/users/signup';
         this.contacts = this.apiEndpoint+'/contacts/all';
     }


    login(username,password){
        axios
            .post(this.login,{username:username,password:password})
            .then(res=>{console.log(res.data);return res;})
            .catch(err=>{console.log(err);return err});

    }

    signup(firstName,lastName,email,password){
        axios
            .post(this.signup,{firstName:firstName, lastName:lastName, email:email, password:password})
            .then(res=>{console.log(res.data);return res;})
            .catch(err=>{console.log(err);return err});

    }




}


export default AuthRepo;
